google.charts.load("current", {packages:["corechart"]});
      google.charts.setOnLoadCallback(drawChart);
      function drawChart() {
        var data = google.visualization.arrayToDataTable([
          ['Authority', 'Estimated Tax'],
                    ['School', 2131.25],
                    ['County', 2177.64],
                    ['Other', 430.79],
                    ['Municipality', 1412.52],
                    ['Non-Ad Valorem', 95],
                  ]);

        var options = {
          title: 'Where your tax dollars are going:',
          is3D: true,
          colors: ['#3366cc','rgb(16, 150, 24)','rgb(220, 57, 18)','rgb(153, 0, 153)','rgb(255, 153, 0)',]
        };

        var chart = new google.visualization.PieChart(document.getElementById('piechart_3d'));
        chart.draw(data, options);
      }
